            <PrivateRoute path="/my-orders/:id" component={OrdersPage} />
            <Route path="/rent/:id" component={RentPage} />
            <Route to="/checkout" component={Checkout} />
          </Switch>
        </Router>
      </ThemeContextProvider>
    </AuthContextProvider>
  );
}

export default App;
